YAHOO.util.Event.onContentReady('content', function(){
	var imgs = YAHOO.util.Dom.get('content').getElementsByTagName('img');
	function refresh() {
		for(var i = 0, l = imgs.length; i < l; i++) {
			imgs[i].src = imgs[i].src.replace(/^(.*?)(\?r=.*)?$/, '$1?r='+Math.random());
		}
	}
	setInterval(refresh, 300*1000);
});

